import React from "react";
import './web.css';
import { Link } from "react-router-dom";


function Web() {
  return <div className="web">
    <div className="web-option">
      <Link to="/project1">About </Link>    
    </div>
    <div className="web-option">
      <Link to="/Work">Work </Link>   
    </div>
    <div className="web-option">
      <Link to="/Work">Also Work </Link>   
    </div>
    <div className="web-option">
        <a href="#contact">
        Contact
        </a>
    </div>
  </div>;
}

export default Web;
